function Post(props) {


  return (
    <div>
      <div id="post">
        <h2>{props.post.name}</h2>
        <p id="date">{props.post.date}</p>       
          <img src={props.post.image} alt={"log"} id="img"/>
          <p id="content">{props.post.content}</p>
      </div>
    </div>
  );  
}

export default Post;
